function stripToJsonObject(s) {
  s = String(s ?? "").trim();
  s = s.replace(/^\s*```(?:json)?\s*/i, "").replace(/\s*```\s*$/i, "").trim();

  const start = s.indexOf("{");
  const end = s.lastIndexOf("}");
  if (start === -1 || end === -1 || end <= start) {
    throw new Error("Could not locate JSON object braces in the text.");
  }
  return s.slice(start, end + 1);
}

function repairJson(s) {
  let t = s;

  // normalize curly quotes
  t = t
    .replace(/[]/g, '"')
    .replace(/[]/g, "'");

  // remove trailing commas before } or ]
  t = t.replace(/,\s*([}\]])/g, "$1");

  // fix: "answer": D  -> "answer":"D"
  // (only for single-letter A/B/C/D)
  t = t.replace(/("answer"\s*:\s*)([ABCD])(\s*[,}])/g, '$1"$2"$3');

  // fix: "answer": D"  -> "answer":"D"
  t = t.replace(/("answer"\s*:\s*)([ABCD])"\s*([,}])/g, '$1"$2"$3');

  // sometimes model returns \n and \" in a half-escaped way
  t = t.replace(/\\n/g, "\n").replace(/\\"/g, '"');

  return t;
}

return items.map((item) => {
  const text = extractText(item.json);
  if (!text) throw new Error("Could not find content[0].text in input item.");

  const raw = stripToJsonObject(text);

  // Try strict parse first, then repair + parse
  try {
    return { json: JSON.parse(raw) };
  } catch (e1) {
    const fixed = repairJson(raw);
    try {
      return { json: JSON.parse(fixed) };
    } catch (e2) {
      // show a small snippet so you can see what broke (without dumping everything)
      const preview = fixed.slice(Math.max(0, fixed.length - 400));
      throw new Error(
        `JSON parse failed even after repair.\nOriginal error: ${e1.message}\nAfter repair error: ${e2.message}\nTail preview:\n${preview}`
      );
    }
  }
});

